  false,\n\t\"url\": null,\n\t\"notes\": \"A survey was conducted from March-September
  1977 to determine the current status of six federally endangered butterflies which
  reside in California. The butterflies are the San Bruno elfin (Callophrys mossii
  bayensis), Misson blue (Plebejus icarioides missionensis), Lotis blue (Lycaeides
  argyrognomon lotis), Smith's blue (Shijimiaeoides enoptes smithi), El Segundo blue
  (Shijimiaeoides battoides allyni), and Lange's metalmark (Apodemia mormo langei).
  The following aspects were investigated for each of the endangered species: (1)
  Survey of the site(s) currently inhabited and exploration for unknown sites; (2)
  Population size, density and mortality factors determined by mark-release-recapture
  techniques (3) Life history investigations to determine larval food plant(s), and;
  (4) Determination of factors threatening their survival.\",\n\t\"license_title\":
